import React from 'react';

const Countries = ({ countryList }) => {
    countryList.map((country) => (
        <li>{country}</li>
    ));
}

export const CountryFilter = () => (
    <div>
        <h3>
            COUNTRY
            </h3>
        <ul>
            {Countries}
        </ul>
    </div>
);
